import React from 'react';
import { Link } from 'react-router-dom';

function GamePreviewItem(props) {
  return (
    <>
      <li className='gamePreview__item'>
        <Link className='gamePreview__item__link' to={props.path}>
          <figure className='gamePreview__item__pic-wrap'>
            <img
              className='gamePreview__item__img'
              alt='GamePreview'
              src={props.src}
            />
          </figure>
          <div className='gamePreview__item__info'>
            <h5 className='gamePreview__item__text'>{props.text}</h5>
          </div>
        </Link>
      </li>
    </>
  );
}

export default GamePreviewItem;
